  01> DAVIES, Megan m on 17.01.1992 to PICKFORD, William Andrew Sterndale
  b 01.05.1959
  b 26.07.1962
  Megan b. at Suva, Fiji and m, at Holy Trinity Cathedral, Parnell, Auckland. Andrew,
  s/o Sterndale Todd Matthew Pickford and Beryl Mildred Flemmer.
  Megan was educated at Auckland Diocesan School, Waikato Diocesan School, Hamilton
  High School and Western Heights High School, Rotorua. She joined the Sheraton Group
  as a receptionist, was promoted to night manager, then to sales manager at the
  Sheraton Hotel, Rotorua. She joined Air New Zealand as a cabin attendant on domestic
  routes before being transferred to the international section till 1990. She then returned to the
  domestic division and was promoted to purser. She was seconded to the Solomon Islands Airline based
  in Honiara for 3 months to train local cabin attendants. Her other interests include sky-diving,
  golf and scuba diving.
  01> PICKFORD, James Todd
  b 11.01.1994
  02> DAVIES, Richard Rhys m on 07.05.1991 to GODDING, Lindsay Clare
  b 14.03.1961
  b 30.09.1963
  Richard b. at Wanganui and m. at Morden Registry Office, London. Lindsay,
  d/o Brian Godding and Rickey Winter.
  Richard was educated at Western Heights High School, Rotorua, and Waikato
  Technical Institute (NZCS). He worked as a laboratory technician at
  Ruakura Research Station, Hamilton (1979-85).
  Lindsay was educated at Ricards Lodge High School, London and trained as
  an auxiliary nurse at Charing Cross Hospital, London (1981-87). She is now Practice Manager at
  Elsham Road Medical Centre, London (1987-).
  01> DAVIES, Luke Rhys
  b 18.05.1993
