  04>' DAVIES, Margaret Dorothy m on 19.07.1958 to BRAMLEY, Frank William (Bill)
  b 01.05.1933
  b 21.02.1930
  i Margaret b. at Manaia and m, at Wanganui. William, s/o Guy Neville Bramley and
  Joan Lydia Waterhouse, b. at Taihape. Address: 18 Braggs Avenue, Taumarunui.
  Margaret was educated at Nga Tawa (1946-50) and Otago School of Physiotherapy.
  She was Athletics Champion at Nga Tawa and gained a University Blue for
  Athletics at the University of Otago. After qualifying as a physiotherapist
  â€¢ she practised her profession at the Wanganui Hospital and in London. She plays
  an active role in community affairs in the King Country. She served for two years as Captain of the
  Taumarunui Ladies Golf Club and is currently secretary of the Save the Children Fund. She enjoys
  playing bridge, cross stitch, gardening, tennis and golf.
  Bill was educated at St George's, Wanganui and Wanganui Collegiate School. He farmed at Kawhatau
  Valley, Mangaweka (1954-64) and while there was Chairman of the Wanganui Young Farmers' Club (1956-57).
  From 1964-89 he farmed at Kirikau, Taumarunui and is now retired. He was Executive Officer of the
  Ruapehu Province Federated Farmers, and is President of the Rotary Club (1997-98),
